import React from "react";
import { Drawer, Form, Row, Col, Button, InputNumber } from "antd";
const TableDrawer = ({ visible, onClose, onHandleAdd }) => {
  return (
    <Drawer closable={false} visible={visible} onClose={onClose}>
      <Form onFinish={onHandleAdd}>
        <Form.Item rules={[{ required: true, message: "Enter table Number" }]}>
          <InputNumber min={0} />
        </Form.Item>
        <Form.Item>
          <Row>
            <Col span={8}>
              <Button type="danger" onClick={onClose}>
                Cancel
              </Button>
            </Col>
            <Col span={8} offset={2}>
              <Button type="primary" htmlType="submit">
                add
              </Button>
            </Col>
          </Row>
        </Form.Item>
      </Form>
    </Drawer>
  );
};

export default TableDrawer;
